DB::table('proyectos')->insert(['id' => 4,'proyecto' => 'BNB','ticker'=>'$BNB','descripcion'=>'BNB (Binance Coin) es el token nativo del ecosistema Binance, lanzado en 2017. Inicialmente creado en la blockchain de Ethereum, luego migró a Binance Chain y Binance Smart Chain (ahora BNB Chain). BNB se utiliza para pagar tarifas en el exchange de Binance, participar en ventas de tokens, y en diversas aplicaciones dentro del ecosistema Web3, como DeFi, NFTs y juegos blockchain. Además, Binance realiza quema periódica de BNB para reducir su suministro y aumentar su valor.','website'=>'https://www.binance.com/en','link_analisis_kairos'=>'https://twitter.com/binance','twitter'=>'N/A','documentacion'=>'N/A','github'=>'https://discord.com/invite/bnbchain','discord'=>'Seed','ultima_ronda'=>'200000000','financiamiento'=>'RRE Ventures','inversionista1'=>'Foundation Capital','inversionista2'=>'VanEck','inversionista3'=>'' ]);
DB::table('proyectos')->insert(['id' => 5,'proyecto' => 'Solana','ticker'=>'$SOL','descripcion'=>'Solana es una blockchain de alta velocidad y escalabilidad, lanzada en 2020, que utiliza un mecanismo de consenso híbrido de Prueba de Historia (Proof of History, PoH) combinado con Prueba de Participación (Proof of Stake, PoS). Su diseño permite procesar hasta 65,000 transacciones por segundo con tarifas bajas, lo que la hace ideal para aplicaciones DeFi, NFTs y Web3 en general. Solana ha ganado popularidad por su rendimiento y su creciente ecosistema de desarrolladores y proyectos.','website'=>'https://solana.com/','link_analisis_kairos'=>'https://twitter.com/solana','twitter'=>'https://solana.com/solana-whitepaper.pdf','documentacion'=>'https://github.com/solana-labs','github'=>'','discord'=>'Indefinida','ultima_ronda'=>'314000000','financiamiento'=>'A16z','inversionista1'=>'Polychain Capital','inversionista2'=>'Multicoin Capital','inversionista3'=>'' ]);
